import "slick-carousel/slick/slick.css";
import "slick-carousel/slick/slick-theme.css";
import React from 'react';
import './App.css';
import Layout from './components/Layout/Layout';
import FetchAllData from "./Helpers/FetchAllData";
import { useDispatch } from "react-redux";
import { setRestaurants } from "./components/Slicers/restaurantsSlicer";

async function App() {
  const ResData = await FetchAllData('restaurants','getRestaurants');
  const dispatch = useDispatch();
  dispatch(setRestaurants(ResData));
  //const ChefData = await FetchAllData('chefs','getChefs');
  return (
    <div className="App">
      <Layout/>
    </div>
  );
}

export default App;
